DELIMITER $$
CREATE PROCEDURE Initial_jet_eng(texti longtext)
BEGIN
    declare engine_specifications_ID int;
    declare manufacturers varchar(255);
    declare models varchar(255);
    declare application varchar(255);
    declare dry_thrust varchar(255);
    declare wet_thrust varchar(255); #pounds/hr
    declare cruise_thrust varchar(255); #pounds/sec
    declare totalSpecific_FuelConsumptiondry varchar(255);
    declare totalSpecific_FuelConsumptionwet varchar(255);
    declare totalSpecific_FuelConsumptioncruise varchar(255);
    declare total_Airflow varchar(255);
    declare overall_PressureRatio varchar(255);
    declare f_p_r varchar(255);
    declare bypass_Ratio varchar(255);
    declare cruise_Altitude varchar(255); 
    declare number_of_Spools varchar(255); 
    declare fan_Stages varchar(255);
    declare low_PressureCompressors varchar(255);
    declare high_PressureCompressors varchar(255);
    declare high_PressureTurbines varchar(255);
    declare intermediate_PressureTurbines varchar(255);
    declare low_PressureTurbines varchar(255);
    declare fan_Width varchar(255);
    declare lengths varchar(255);
    declare widths varchar(255);
    declare dryweights varchar(255);
    
    
    declare strlength int;

    set strlength = char_length(texti);
    while (strlength > 0) do
    
        set manufacturers = substring_index(texti,';',1);
        set texti = substring(texti,locate(';',texti) + 1);
        
        set models = substring_index(texti,';',1);
        set texti = substring(texti,locate(';',texti) + 1);
        
        set application = substring_index(texti,';',1);
        set texti = substring(texti,locate(';',texti) + 1);
        
        set dry_thrust = substring_index(texti,';',1);
        set texti = substring(texti,locate(';',texti) + 1);
        
        set wet_thrust = substring_index(texti,';',1);
        set texti = substring(texti,locate(';',texti) + 1);
        
        set cruise_thrust = substring_index(texti,';',1);
        set texti = substring(texti,locate(';',texti) + 1);
        
